import { Link } from "react-router-dom";
import React, { useEffect } from "react";
import "../../assets/styles/nav.scss"
import ball from "./pokeball.png"

const Navbar = () => {

    useEffect(() => {   
        document.getElementById('ball').addEventListener('click', function(){
            document.getElementById('ball').classList.toggle('pokeball-animation')
            document.getElementById('ball').style.backgroundColor = "blue"
        })
    });

    return (
        <>
            <image  src={ball} alt="pokeball" className="pokeball-toggler" id="ball"/>
            <div className="navbar">

            </div>
        </>
    )
}

export default Navbar
